La Société des journalistes de “60 Millions de consommateurs” a été créée durant l'été 2019. Elle rassemble à ce jour la quasi-totalité des membres de la rédaction de @60millions.

Ses missions :
- préserver l'indépendance des journalistes et des médias de 60 Millions ;

"L’éclairage du  choix  du  consommateur, à travers une information indépendante et claire, et l’amélioration de l’environnement alimentaire"
